import React from 'react'
import './Movies.css'

const MovieCard =  (props) => {
    return (
        <div className='movie-info'>
            <div></div>
            <h3>{props.title}</h3>
           <img src = {props.image}/>

        </div>  
    )
}

export default MovieCard
